//1x748 * 748*10
//node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_weights, tensor_layer_1_MatMul_output)
static inline void node_layer_1_MatMul(const _Bool A[INPUT_LAYER_SIZE_COL], int Y[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        Y[i] = tensor_layer_1_Add_bias[i];
        for (int j = 0; j < INPUT_LAYER_SIZE_ROW; j++) {
            Y[i] += (A[j] && tensor_layer_1_MatMul_weights[j][i]);
        }
        //printf("[ node_layer_1_MatMul] %d \n", Y[i]);
    }

}

static inline void node_layer_1_ReLU(const int tensor_layer_1_MatMul_output[INPUT_LAYER_SIZE_COL], int tensor_layer_1_Relu_output[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_layer_1_Relu_output[i] = RELU(tensor_layer_1_MatMul_output[i]);
        //printf("tensor_layer_1_Relu_output[%d]: %f\n", i1, tensor_layer_1_Relu_output[i]);
    }

}

static inline void node_layer_1_BN(const int tensor_layer_1_Relu_output[INPUT_LAYER_SIZE_COL], float tensor_layer_1_BN_output[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_layer_1_BN_output[i] = ((float)tensor_layer_1_Relu_output[i] - tensor_layer_1_batch_mean[i]) * tensor_layer_1_batch_var_modified[i];
        //printf("tensor_layer_1_BN_output: %f\n", tensor_layer_1_BN_output[i]);
    }
}

static inline void node_layer_2_MatMul(const float tensor_layer_1_BN_output[INPUT_LAYER_SIZE_COL], int Y[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        Y[i] = tensor_layer_2_Add_bias[i];
        for (int j = 0; j < INPUT_LAYER_SIZE_COL; j++) {
            _Bool input = BINARISE(tensor_layer_1_BN_output[j]);
            Y[i] += (input && tensor_layer_2_MatMul_weights[j][i]);
        }
        //printf("[ node_layer_2_MatMul] %d \n", Y[i]);
    }
}

static inline void node_layer_2_ReLU(const int tensor_layer_2_MatMul_output[INPUT_LAYER_SIZE_COL], int tensor_layer_2_Relu_output[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_layer_2_Relu_output[i] = RELU(tensor_layer_2_MatMul_output[i]);
        //printf("tensor_layer_1_Relu_output[%d]: %f\n", i1, tensor_layer_1_Relu_output[i]);
    }

}

static inline void node_layer_2_BN(const int tensor_layer_2_Relu_output[INPUT_LAYER_SIZE_COL], float tensor_layer_2_BN_output[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_layer_2_BN_output[i] = ((float)tensor_layer_2_Relu_output[i] - tensor_layer_2_batch_mean[i]) * tensor_layer_2_batch_var_modified[i];
        //printf("tensor_layer_1_BN_output: %f\n", tensor_layer_1_BN_output[i]);
    }
}


static inline void node_layer_ReLU(const float tensor_layer_2_BN_output[INPUT_LAYER_SIZE_COL], float output[INPUT_LAYER_SIZE_COL])
{
    for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        output[i] = RELU(tensor_layer_2_BN_output[i]);
    }
}

int main()
{
    _Bool tensor_input[INPUT_LAYER_SIZE_ROW];
    float tensor_output[INPUT_LAYER_SIZE_COL];

    __ESBMC_init_object(tensor_input);

    for (int i = 0; i < 784; i++) {
        if (test_data[i] && 1)
            __ESBMC_assume(tensor_input[i] == 1);
        else
            __ESBMC_assume(tensor_input[i] == 0);

    }

    node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_output);
    node_layer_1_ReLU(tensor_layer_1_MatMul_output, tensor_layer_1_Relu_output);
    node_layer_1_BN(tensor_layer_1_Relu_output, tensor_layer_1_BN_output);

    node_layer_2_MatMul(tensor_layer_1_BN_output, tensor_layer_2_MatMul_output);
    node_layer_2_ReLU(tensor_layer_2_MatMul_output, tensor_layer_2_Relu_output);
    node_layer_2_BN(tensor_layer_2_Relu_output, tensor_layer_2_BN_output);

    node_layer_ReLU(tensor_layer_2_BN_output, tensor_output);

    int number = 9;

    for (int i = 0; i < 10; i++) {
        if (i != number) {
            __ESBMC_assert(tensor_output[number] >= tensor_output[i], "");
        }
    }

    return 0;
}

